static QCString stripEmptyLines(const char *s)
{
  if (s==0) return QCString();
  int result=0,p=0;
  for (;;)
  {
    int c;
    while ((c=s[p]) && isspace(c)) p++;
    if (s[p]=='\n') result=++p; else break;
  }
  return &s[result];
}

